import React from 'react'
import {Wrapper, Paragraph, H4} from '../Styled'
import styled from 'styled-components'
import FiberManualRecord from '@material-ui/icons/FiberManualRecord';
import PhoneIphone from '@material-ui/icons/PhoneIphone';
import Cached from '@material-ui/icons/Cached';

const MinimalIcon = styled(FiberManualRecord)`
    color: var(--p-1);
`

const MobileIcon = styled(PhoneIphone)`

`

const ComponentIcon = styled(Cached)`

`

const CardContainer = styled(Wrapper)`
    width: 100%;
    display:flex;
    flex-direction:row;
`

const ValueCard = styled.div`
    display:flex;
    flex-direction:column;
    align-items:center;
    height:20em;
    width:15em;
` 

const Icon = styled.div`
    display:flex;
    justify-content:center:
    align-items:center;
    height:5em;
`

export default function Values() {
    return (
        <CardContainer>
            <ValueCard>
                <Icon><MinimalIcon/></Icon>
                <H4>minimal</H4>
                <Paragraph>
                    Less but Better in the Age of distraction.
                </Paragraph>
            </ValueCard>
            <ValueCard>
                <Icon><MobileIcon/></Icon>
                <H4>mobile first </H4>
                <Paragraph>
                    Designed for optimal mobile experience, but adaptive to desktop views.
                </Paragraph>
            </ValueCard>
            <ValueCard>
                <Icon><ComponentIcon/></Icon>
                <H4>component based </H4>
                <Paragraph>
                    Component Based Architecture for consistancy and quick design adaptions.
                </Paragraph>
            </ValueCard>
        </CardContainer>
    )
}
